import { BrowserRouter as Link } from 'react-router-dom'


function Navbar() {
    return (
        <ul>
            <Link to="/">Home</Link>
            <Link to="/company">Empresa</Link>
            <Link to="/contact">Contato</Link>
            <Link to="/newProject">Novo Projeto</Link>
        </ul>
    )
}

export default Navbar
